import React from "react";
import { card } from "../components/card";
import { ListImage } from "../components/image";

const index = () => {
    return (
        <>
            <div class="flex flex-no-wrap bg-gray-200 overflow-hidden">
                {ListImage.map(src => (
                    card({ img: src })
                ))}
            </div>

        </>
    )
}

export default index;
